import React from 'react'
import ProductCard from '../ProductCard'
import ProductList from '../ProductList'
import { useParams } from 'react-router-dom'

import { useSelector } from 'react-redux'

const SearchFeed = () => {

     const {searchTerm} = useParams()
     const productsSlice = useSelector(state => state.products)
     const {products} = productsSlice
     const filterProducts = products.filter((product) => product.ProductName.includes(searchTerm))
    
    console.log(filterProducts)
   
     console.log(products)
    // if(products.loading) return 'Loading...'
    return (
        //  <div className='d-flex justify-content-center' style={{width:'100%'}}>
        <div  style={{display:'flex', flexWrap:'wrap', gap:'10px', padding:'10px', width:'100%',  justifyContent:'center'}}>
         <ProductCard products={products}/>
         
        </div>
    )
}

export default SearchFeed
